import product1 from "./assets/products/product1.PNG";
import product2 from "./assets/products/product2.PNG";
import product3 from "./assets/products/product3.PNG";

const products = [
  {
    id: 1,
    name: "Wheat Growth Booster",
    category: "Fertilizer",
    image: product1,
    short: "Enhances wheat yield with balanced nutrients.",
  },
  {
    id: 2,
    name: "Paddy Guard",
    category: "Pesticide",
    image: product2,
    short: "Protects rice crops from insects and fungus.",
  },
  {
    id: 3,
    name: "Organic Compost",
    category: "Soil Improver",
    image: product3,
    short: "100% organic compost to improve soil fertility.",
  },
];


export default products;
